class LoginComponent {
    constructor(authService, router, userService, route) {
        this.authService = authService;
        this.router = router;
        this.userService = userService;
        this.route = route;
    }
    ngOnInit() {
        this.userService.authState$.subscribe(authState => {
            if (authState) {
                let userRole = localStorage.getItem('userRole');
                // this.router.navigateByUrl(this.route.snapshot.queryParams.returnUrl || '/profile');
                if (userRole == '777') {
                    this.router.navigateByUrl('admin').then();
                }
                if (userRole == '555') {
                    this.router.navigateByUrl('profile').then();
                }
                if (userRole == '666') {
                    this.router.navigateByUrl('vendor-profile').then();
                }
            }
            else {
                this.router.navigateByUrl('/login');
            }
        });
    }
    signInWithGoogle() {
        this.userService.googleLogin();
    }
    login(form) {
        const email = this.email;
        const password = this.password;
        if (form.invalid) {
            return;
        }
        form.reset();
        this.userService.loginUser(email, password);
        this.userService.loginMessage$.subscribe(msg => {
            this.loginMessage = msg;
            setTimeout(() => {
                this.loginMessage = '';
            }, 5000);
        });
        // this.userService.registerUser({...this.registrationForm.value}).subscribe((response: any) => {
        //   this.registrationMessage = response.message;
        // });
    }
}


